import { deleteGoal } from '../../GoalsPageScripting';

function DeleteGoalModal(props) {
    return(
        <div className="DeleteGoalModal">
            <div className="ModalBackground">
                <div className="ModalContainer">
                    <h1>{"Are You Sure You Want To Delete Goal: " + props.goals[props.goalId].name + "?"}</h1>
                    <button onClick={() => {props.modalOpen(false);}}>Confirm</button>
                    <button onClick={() => props.modalOpen(false)}>Cancel</button>
                </div>
            </div>
        </div>
    )
}

export default DeleteGoalModal;
